    return(
        <Grid>
            <Grid.Column width={4}>
                <Menu fluid vertical tabular>
                    <Menu.Item name='Home' />
                </Menu>
            </Grid.Column>
            <Grid.Column stretched width={12}>
                <Segment>
                    Hello
                </Segment>
            </Grid.Column>

        </Grid>
    );
}
